DROP TABLE IF EXISTS `cron_jobs`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cron_jobs` (
  `id` varchar(255) NOT NULL,
  `releaseId` varchar(255) NOT NULL,
  `stage1Status` enum('PENDING','IN_PROGRESS','COMPLETED') DEFAULT 'PENDING',
  `stage2Status` enum('PENDING','IN_PROGRESS','COMPLETED') DEFAULT 'PENDING',
  `stage3Status` enum('PENDING','IN_PROGRESS','COMPLETED') DEFAULT 'PENDING',
  `auto_transition_to_stage3` tinyint(1) NOT NULL DEFAULT '0',
  `cronStatus` enum('PENDING','RUNNING','PAUSED','COMPLETED') DEFAULT 'PENDING',
  `cronCreatedAt` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `cronStoppedAt` timestamp NULL DEFAULT NULL,
  `cronCreatedByAccountId` varchar(255) NOT NULL,
  `regressionTimings` varchar(255) DEFAULT '09:00,17:00',
  `upcomingRegressions` json DEFAULT NULL,
  `cronConfig` json NOT NULL,
  `regressionTimestamp` varchar(255) DEFAULT NULL,
  `locked_by` varchar(255) DEFAULT NULL COMMENT 'Instance ID holding the lock (for horizontal scaling)',
  `locked_at` datetime DEFAULT NULL COMMENT 'When lock was acquired',
  `lock_timeout` int(11) DEFAULT '300' COMMENT 'Lock timeout in seconds (default 300 = 5 minutes)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `releaseId` (`releaseId`),
  KEY `idx_cron_jobs_created_by` (`cronCreatedByAccountId`),
  KEY `idx_cron_jobs_locked` (`locked_by`,`locked_at`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
