--
-- Table structure for table `releases`
--

DROP TABLE IF EXISTS `releases`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `releases` (
  `id` varchar(255) NOT NULL,
  `tenantId` char(36) CHARACTER SET latin1 COLLATE latin1_bin NOT NULL,
  `createdAt` datetime DEFAULT CURRENT_TIMESTAMP,
  `releaseKey` varchar(255) NOT NULL,
  `updatedAt` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `kickOffReminderDate` datetime DEFAULT NULL,
  `plannedDate` datetime NOT NULL,
  `releaseDate` datetime DEFAULT NULL,
  `targetReleaseDate` datetime NOT NULL,
  `isDelayed` tinyint(1) DEFAULT '0',
  `delayedReason` text,
  `version` varchar(255) NOT NULL,
  `type` enum('HOTFIX','PLANNED','MAJOR') DEFAULT 'PLANNED',
  `status` enum('PENDING','STARTED','REGRESSION_IN_PROGRESS','BUILD_SUBMITTED','RELEASED','ARCHIVED') DEFAULT 'PENDING',
  `baseVersion` varchar(255) NOT NULL,
  `baseBranch` varchar(255) DEFAULT NULL,
  `branchRelease` varchar(255) DEFAULT NULL,
  `branchCodepush` varchar(255) DEFAULT NULL,
  `updateType` enum('OPTIONAL','FORCE') DEFAULT 'OPTIONAL',
  `createdByAccountId` varchar(255) DEFAULT NULL,
  `parentId` varchar(255) DEFAULT NULL,
  `releasePilotAccountId` varchar(255) NOT NULL,
  `lastUpdateByAccountId` varchar(255) NOT NULL,
  `iOSTestRunId` varchar(255) DEFAULT NULL,
  `webTestRunId` varchar(255) DEFAULT NULL,
  `playStoreRunId` varchar(255) DEFAULT NULL,
  `webEpicId` varchar(255) DEFAULT NULL,
  `playStoreEpicId` varchar(255) DEFAULT NULL,
  `iOSEpicId` varchar(255) DEFAULT NULL,
  `releaseTag` varchar(255) DEFAULT NULL,
  `slackMessageTimestamps` json DEFAULT NULL,
  `iOSUserAdoption` int(11) DEFAULT '0',
  `playstoreUserAdoption` int(11) DEFAULT '0',
  `webUserAdoption` int(11) DEFAULT '0',
  `webFinalBuildNumber` varchar(255) DEFAULT NULL,
  `PSFinalBuildNumber` varchar(255) DEFAULT NULL,
  `IOSFinalBuildNumber` varchar(255) DEFAULT NULL,
  `stage_data` json DEFAULT NULL COMMENT 'Stores integration responses per stage (JSON object)',
  `custom_integration_configs` json DEFAULT NULL COMMENT 'Per-release integration config overrides (JSON object)',
  `pre_created_builds` json DEFAULT NULL COMMENT 'Array of pre-created builds: [{"platform": "IOS", "target": "APP_STORE", "buildNumber": "...", "buildUrl": "..."}]',
  PRIMARY KEY (`id`),
  UNIQUE KEY `releaseKey` (`releaseKey`),
  KEY `idx_releases_tenant` (`tenantId`),
  KEY `idx_releases_tenant_created` (`tenantId`,`createdAt`),
  KEY `idx_releases_tenant_status_planned` (`tenantId`,`status`,`plannedDate`),
  KEY `idx_releases_pilot_status` (`releasePilotAccountId`,`status`),
  KEY `idx_releases_last_updater` (`lastUpdateByAccountId`),
  KEY `idx_releases_parent` (`parentId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

