  `webhookUrl` varchar(512) DEFAULT NULL COMMENT 'Delivr webhook endpoint URL',
  `webhookEnabled` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Is webhook active?',
  `senderLogin` varchar(255) DEFAULT NULL COMMENT 'GitHub username for commits/operations attribution',
  `providerConfig` json DEFAULT NULL COMMENT 'Additional provider-specific configuration',
  `isActive` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Soft delete flag',
  `verificationStatus` enum('PENDING','VALID','INVALID','EXPIRED') NOT NULL DEFAULT 'PENDING' COMMENT 'Connection status (verified via GitHub API)',
  `lastVerifiedAt` datetime DEFAULT NULL COMMENT 'Last successful verification',
  `verificationError` text COMMENT 'Error message if verification failed',
  `createdByAccountId` varchar(255) NOT NULL,
  `createdAt` datetime NOT NULL,
  `updatedAt` datetime NOT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_scm_tenant` (`tenantId`,`isActive`),
  KEY `idx_scm_owner_repo` (`owner`,`repo`),
  KEY `idx_scm_verification` (`verificationStatus`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
